import React from "react";
import CustomSlider from "../slider/custom.slider";
import images from "../data/images";

function Home() {
  return (
    <div>
      <CustomSlider>
        {images.map((image, index) => {
          return (
            <div key={index}>
              <img src={image.imgURL} alt={image.imgAlt} />
              <div className="slider__item-content">
                <h1>{image.heading}</h1>
              </div>
            </div>
          );
        })}
      </CustomSlider>
    </div>
  );
}

export default Home;
